import React from 'react';
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
      <NavLink className="navbar-brand" to="/">ExerciseTracker</NavLink>
      <div className="collapse navbar-collapse">
        <ul className="navbar-nav mr-auto">
          {/* <li className="nav-item">
            <NavLink exact className="nav-link" to="/">Exercises</NavLink>
          </li> */}
          <li className="nav-item">
            <NavLink className="nav-link" to="/create">Create Exercise Log</NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" to="/user">Create User</NavLink>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
